package 실습문제;

public class 연산자문제_5 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int num1=10;   
	      System.out.printf("%d \n", num1);
	      num1++;
	      System.out.printf("%d \n", num1);
	      ++num1;
	      System.out.printf("%d \n", num1);
	      --num1;
	      System.out.printf("%d \n", num1);
	      num1--;
	      System.out.printf("%d \n", num1);

	}

}
